	//=========== trands-slider
	if ('.trand-products') {
		$('.trand-products__slider').slick({
			infinite: true,
			arrows: true,
			slidesToShow: 4,
			slidesToScroll: 1,
			appendArrows: $('.trand-products__arrows'),
			responsive: [
				{
					breakpoint: 1200,
					settings: {
						slidesToShow: 3,
						slidesToScroll: 1,
						infinite: true
					}
				},
				{
					breakpoint: 992,
					settings: {
						slidesToShow: 2,
						slidesToScroll: 1,
						infinite: true
					}
				},
				{
					breakpoint: 560,
					settings: {
						slidesToShow: 1,
						slidesToScroll: 1,
						infinite: true
					}
				}
			]
		});
	}
	//===========category-slider============

	if ('.categogy-items') {
		function slickMobile() {
			$('.categogy-items').slick({
				infinite: true,
				arrows: true,
				slidesToShow: 1,
				slidesToScroll: 1,
				responsive: [
					{
						breakpoint: 560,
						settings: {
							slidesToShow: 1,
							slidesToScroll: 1,
							infinite: true
						}
					},
					{
						breakpoint: 4000,
						settings: 'unslick'
					},
					{
						breakpoint: 560,
						settings: 'slick'
					}
				]
			});
		}
	}

	//=========product-slider===============
	if ('.product-slider') {
		$('.product-slider').slick({
			infinite: true,
			arrows: true,
			slidesToShow: 1,
			slidesToScroll: 1,
			draggable: false,
			asNavFor: '.vertical-slider',
			appendArrows: $('.product-slider__arrows')
		});
	}

	if ('.vertical-slider') {
		function slickDesk() {
			$('.vertical-slider').slick({
				infinite: true,
				arrows: false,
				vertical: true,
				slidesToShow: 4,
				slidesToScroll: 1,
				verticalSwiping: true,
				asNavFor: '.product-slider',
				focusOnSelect: true,
				responsive: [
					{
						breakpoint: 560,
						settings: 'unslick'
					}
				]
			});
		}
	}

	slickDesk();
	$(window).resize(function() {
		var $windowWidth = $(window).width();
		if ($windowWidth > 560) {
			slickDesk();
		}
	});
	slickMobile();
	$(window).resize(function() {
		var $windowWidth = $(window).width();
		if ($windowWidth < 560) {
			slickMobile();
		}
	});

