	//==============filter__price==================

	if (document.querySelector('.filter__price')) {
		priceSlider = document.querySelector('.filter__price_slider');
		noUiSlider.create(priceSlider, {
			start: [ 0, 60000 ],
			step: 1000,
			tooltips: [ wNumb({ decimals: 0 }), wNumb({ decimals: 0 }) ],
			connect: true,
			range: {
				min: 0,
				max: 60000
			}
		});
	}
